import React from "react";
import { NavLink } from "react-router-dom";

const Card = ({ name, category, image, description }) => {
  return (
    <div className="card-main">
      <div className="card-row">
        <div className="card-container">
          <div className="card-body">
            <h2 className="strong">
              {name} 
            </h2>
            <p className="card-text">{category}<br/>{description}</p>
            <NavLink className="btn btn-secondary" to="/details">
              Edit
            </NavLink>
            <button className="btn btn-secondary px-2">Delete</button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
